import './App.css';
import Header from "./components/Header";
import Body from "./components/Body";
import {BrowserRouter, Link, Routes, Route} from "react-router-dom";
import CategorieCafe from "./components/CategorieCafe";
import CategorieThe from "./components/CategorieThe";

function App() {
    return (
        <>
            <div className="App">
                <BrowserRouter>
                    <Header/>
                    <Routes>
                        <Route exact path="/" element={<Body/>}/>
                        <Route path="/categorie/cafe" element={<CategorieCafe/>}/>
                        <Route path="/categorie/the" element={<CategorieThe/>}/>
                        <Route path="/meilleures_ventes" element={<CategorieThe/>}/>
                    </Routes>
                </BrowserRouter>
            </div>
        </>
    );
}

export default App;
